-- Table structure for table `goods`
--

DROP TABLE IF EXISTS `goods`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) DEFAULT NULL COMMENT '商品名称',
  `category_id` int(11) DEFAULT NULL COMMENT '分类id',
  `cover` varchar(255) DEFAULT NULL COMMENT '商品封面图',
  `rating` float DEFAULT '5' COMMENT '平均评分',
  `sale_count` int(11) DEFAULT '0' COMMENT '总销量',
  `review_count` int(11) DEFAULT '0' COMMENT '评论数',
  `min_price` decimal(10,2) DEFAULT NULL COMMENT '最低sku价格',
  `min_oprice` decimal(10,2) NOT NULL DEFAULT '0.00',
  `desc` varchar(255) DEFAULT NULL COMMENT '商品描述',
  `unit` varchar(10) DEFAULT NULL COMMENT '单位',
  `stock` int(11) DEFAULT '0' COMMENT '库存',
  `min_stock` int(11) DEFAULT '0' COMMENT '库存预警',
  `ischeck` tinyint(1) DEFAULT '0' COMMENT '是否审核 0审核中 1通过 2拒绝',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态 0仓库1上架',
  `stock_display` tinyint(1) DEFAULT '1' COMMENT '库存显示 0隐藏 1显示',
  `express_id` int(11) DEFAULT '0' COMMENT '运费模板id',
  `sku_type` tinyint(1) DEFAULT '0' COMMENT 'sku类型：0单一，1多规格',
  `sku_value` varchar(255) DEFAULT NULL COMMENT '单一规格值',
  `content` text COMMENT '商品详情',
  `discount` float DEFAULT '0' COMMENT '折扣设置',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `delete_time` int(11) DEFAULT NULL,
  `order` int(11) DEFAULT '50' COMMENT '排序',
