--
-- Table structure for table `order`
--

DROP TABLE IF EXISTS `order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `no` varchar(255) DEFAULT NULL COMMENT '订单唯一流水号',
  `user_id` int(11) DEFAULT NULL,
  `address` text COMMENT '收货地址',
  `total_price` decimal(10,2) DEFAULT NULL COMMENT '订单总价格',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `paid_time` int(11) DEFAULT NULL COMMENT '支付时间',
  `payment_method` varchar(255) DEFAULT NULL COMMENT '支付方式',
  `payment_no` varchar(255) DEFAULT NULL COMMENT '支付平台订单号',
  `refund_status` varchar(50) DEFAULT 'pending' COMMENT '退款状态',
  `refund_no` varchar(255) DEFAULT NULL COMMENT '退款单号',
  `closed` tinyint(1) DEFAULT '0' COMMENT '是否关闭',
  `ship_status` varchar(50) DEFAULT 'pending' COMMENT '物流状态',
  `ship_data` text COMMENT '物流数据',
  `extra` text COMMENT '额外数据',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `reviewed` tinyint(1) DEFAULT '0' COMMENT '是否已评价',
  `coupon_user_id` int(11) DEFAULT '0' COMMENT '使用优惠券id',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `order_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=348 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

