DROP TABLE IF EXISTS `order_item`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `order_item` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT NULL COMMENT '订单id',
  `shop_id` int(11) DEFAULT NULL COMMENT '商品id/商品规则id',
  `num` int(11) DEFAULT NULL COMMENT '购买数量',
  `price` decimal(10,2) DEFAULT NULL COMMENT '购买价格',
  `rating` int(11) DEFAULT NULL COMMENT '评分',
  `review` text COMMENT '评价',
  `review_time` int(11) DEFAULT NULL COMMENT '评价时间',
  `create_time` int(11) DEFAULT NULL,
  `skus_type` tinyint(4) DEFAULT '1' COMMENT '规格类型',
  `goods_id` int(11) DEFAULT NULL,
  `goods_num` int(11) NOT NULL DEFAULT '0',
  `user_id` int(11) NOT NULL DEFAULT '0',
  `extra` text COMMENT '客服回复评论',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否可用,1：可用，0不可用',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`) USING BTREE,
  CONSTRAINT `order_item_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `order` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=404 DEFAULT CHARSET=utf8;
